import React from 'react'
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import 'bootstrap-icons/font/bootstrap-icons.css';

const NavigationBar = () => {
  return (
    <Navbar className = "bg-dark align-items-center text-center pl-3" expand="lg" variant="dark">
        <Container fluid>
            
            <Navbar.Brand href="#" className='pl-2' variant="dark">Forecast</Navbar.Brand>
            <Navbar.Toggle aria-controls="navbarScroll" />
            <Navbar.Collapse id="navbarScroll">
            <Nav
                className=" ml-5 my-lg-0 text-center"
                style={{ maxHeight: '100px' }}
                navbarScroll
            >
                <Nav.Link href="#" className = "pl-5" ><i className="bi bi-arrow-clockwise"></i></Nav.Link>
                <Nav.Link href="#" ><i className="bi bi-star"></i></Nav.Link>
                <Nav.Link href="#" ><i className="bi bi-moon-fill"></i></Nav.Link>
            </Nav>
            <Form className="d-flex ms-auto">
                <FormControl
                type="search"
                placeholder="Search"
                className="me-2 bg-secondary"
                aria-label="Search"
                />
                <Button className = "btn btn-secondary">Search</Button>
            </Form>
            </Navbar.Collapse>
        </Container>
    </Navbar>
  )
}

export default NavigationBar
